  `hits` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `appraise` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评价个数',
  `state` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1已审核 0未审核',
  PRIMARY KEY (`id`)
